import styled from 'styled-components';

export const Wrapper = styled.div`
  margin: 16px;
  /* display: grid; */
  justify-content: center;

  h1 {
    font-weight: bold;
    font-size: 32px;
    @media(max-width: 800px) {
      font-size:20px;
     };
  }
`;
